import React  from "react";
import axios from 'axios';
import { DataGrid } from "@mui/x-data-grid";


const Pizza = props =>{
    const [data, setData] = React.useState([]);
    let datarows = React.useState([]);
    let datacols = React.useState([]);

    React.useEffect(()=>{
        axios('http://localhost:5000/pizza')
        .then(response=>{
            if(response.status===200){
                const datarows =response.data.rows;
                datacols = response.data.metaData;
                console.log(datacols)
                console.log(datarows);
                setData(datarows);
            }
        })
        .catch(err=>{
            console.log(err);
        })
    },[]);

    const test = () => {
        console.log('TEST')
        axios('http://localhost:5000/pizza')
            .then(response=>{
                if(response.status===200){
                    datarows =response.data.rows;
                    console.log(datarows);
                    setData(datarows);
                    console.log(datarows[1]);
                    return (
                        <div id='datarows'>{datarows}</div>
                    )
                }
            })
            .catch(err=>{
                console.log(err);
            })
    }

    return(<div>
        Pizza Component
        {
            data.length>0 &&
            data.map((item,index)=>
            <div key={index}>{index}-{item}</div>)
        }
        <button id='button' onClick={test}>TEST</button>
        <div id='datarows'></div>

    </div>)
}

export default Pizza;
